import React from 'react';
import './Dev.css';

function Dev(imageSource, devName, techs, bio, githubSource) {
  return (
    <>
      <header>
        <img src={imageSource} alt={devName} />
        <div className="user-info">
          <strong>{devName}</strong>
          <span>{techs}</span>
        </div>
      </header>
      <p>{bio}</p>
      <a href={githubSource}>Perfil no GitHub</a>
    </>
  );
}

export default Dev;
